import React from "react";
import Card from "./Card";
import contacts from "../contacts";

function newCard(contact){
  return (<Card
      name={contact.name}
      img={contact.imgURL}
      tel={contact.phone}
      email={contact.email}
      />)
}

function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      {contacts.map(newCard)}
    </div>
  );
}

export default App;
